import React from "react";

const Trailer = (props) => {
  let url = `https://www.youtube.com/embed/${props.trailer}`;
  return (
    <div style={{ width: "960", height: "1080" }} frameBorder="0">
      <embed
        style={{ width: "580px", height: "350px" }}
        type="video/webm"
        src={url}
      />
    </div>
  );
};

export default Trailer;
